import React from "react";
import NavBar from "../pages/NavBar";
import "./Home.css";
import Hero from "../pages/Hero";
const Home = () => {
  return (
    <div id="MainContainer">
    <NavBar/>
    <Hero/>
    </div>
  );
};

export default Home;
